import { AUTH } from "../constants/actionTypes";
import * as api from "../api";

export const signUp = (formData, history) => async (dispatch) => {
  try {
    //log in the user
    history("/");
  } catch (error) {
    console.log(error);
  }
};
export const signIn = () => async (dispatch) => {
  try {
    //sign up the user
    history("/");
  } catch (error) {
    console.log(error);
  }
};
